INSERT INTO Wards(Id,[name],[type],slug,name_with_type,[path],path_with_type,code,parent_code)
SELECT *
FROM OPENJSON (@json, N'$')
  WITH (
	Id UNIQUEIDENTIFIER N'$.ID',
    [name] NVARCHAR(MAX) N'$.name',
    [type] NVARCHAR(MAX) N'$.type',
	slug NVARCHAR(MAX) N'$.slug',
    name_with_type NVARCHAR(MAX) N'$.name_with_type',
	[path] NVARCHAR(MAX) N'$.path',
	path_with_type NVARCHAR(MAX) N'$.path_with_type',
	code NVARCHAR(MAX) N'$.code',
	parent_code NVARCHAR(MAX) N'$.parent_code'
);